  render() {
  return (
     <div className='contents'>

    <div id="vote-wrapper" className="card car-wrapper">
    <h5>この回答はお役に立ちましたか？</h5>
      <div className="button-choice-wrapper">
        <Link href="/edit">
          <a  className="button button-black-ol button-choice-l ">はい
        </a></Link>

      <a  className="button  button-black-ol button-choice-r">いいえ
          </a>
        </div>
     </div>

     </div>
  );
}
}
export default VoteForm;
